import React, { useState, useEffect } from 'react';
import '../styles/TrafficDashboard.css';

function TrafficDashboard() {
    const [trafficData, setTrafficData] = useState([]);

    useEffect(() => {
        // Fetch initial traffic data from backend API
        fetch('http://localhost:5000/ingest')
            .then(response => response.json())
            .then(data => setTrafficData(data))
            .catch(error => console.error('Error fetching traffic data:', error));
    }, []);

    return (
        <div className="traffic-dashboard">
            <h1>Smart Traffic Management Dashboard</h1>
            <ul>
                {trafficData.map((data, index) => (
                    <li key={index}>
                        Location: {data.location}, Congestion Level: {data.congestionLevel}
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default TrafficDashboard;
